import React from "react";
import DisplayPicture from "../component/DisplayPicture";

function BioDiv() {
  return (
    <div className="container">
      <div
        className="image-div"
        style={{ display: "block", border: "1px solid black", padding: "10px" }}
      >
        <DisplayPicture />{" "}
      </div>
      <div className="introduction">
        <h2>Introduction</h2>
        <p>
          Studied industrial engineering and work as a quality engineer for the
          first 3 years in my career but somehow end up in the web world.
        </p>
      </div>
      <div> </div>
    </div>
  );
}

export default BioDiv;
